import React, {Component} from "react";

class MemeGenerator extends Component {
    constructor() {
        super()
        this.state = {
            topText: "",
            bottomText: "",
            randomImg: "https://www.shutterstock.com/image-photo/red-fox-vulpes-bushy-tail-260nw-625736129.jpg"
        }

    }
    componentDidMount() {
        fetch("https://api.imgflip.com/get_memes")
            .then(response => response.json())
            .then(response => {
                const {memes} = response.data
                console.log(memes[0])
                this.setState({allMemeImags: memes})
            })
    }
    render() {
        return (
            <div>
                <form className="meme-form">
                    <input
                        type="text"
                        name="topText"
                        placeholder="Top Text"
                        value={this.state.top}
                        />

                </form>
            </div>
        )
    }
}
export default MemeGenerator
